(()=>{"use strict";fetch("https://www.thecocktaildb.com/api/json/v1/1/search.php?s=margarita").then((t=>t.json())).then((t=>{t.drinks.forEach((t=>{const c=`\n      <li class="img-cocktail" \n      style="background-image: url(${t.strDrinkThumb})">\n      ${t.strDrink}</li>\n      `;document.querySelector(".cocktail-list").insertAdjacentHTML("beforeend",c)}))}))})();